import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

export default function Navbar() {
    const { user, logout } = useAuth();
    const [isMenuOpen, setIsMenuOpen] = useState(false);

    // Effect to prevent scrolling when the menu is open
    useEffect(() => {
        if (isMenuOpen) {
            document.body.style.overflow = 'hidden';
        } else {
            document.body.style.overflow = 'auto';
        }
        // Cleanup function to restore scrolling when component unmounts
        return () => {
            document.body.style.overflow = 'auto';
        };
    }, [isMenuOpen]);


    const handleMenuClose = () => setIsMenuOpen(false);

    const renderNavLinks = (isMobile = false) => {
        const linkClass = isMobile ? "text-lg py-3 px-4 w-full text-left hover:bg-gray-700 rounded-md" : "hover:text-gray-300";
        const buttonClass = isMobile ? "text-lg text-left w-full px-4 py-3 bg-red-600 rounded-md hover:bg-red-700 font-bold" : "px-3 py-1 bg-red-600 rounded hover:bg-red-700";

        return (
            <>
                {user ? (
                    <>
                        <Link to="/dashboard" className={linkClass} onClick={handleMenuClose}>Dashboard</Link>
                        <Link to="/quiz/setup" className={linkClass} onClick={handleMenuClose}>New Quiz</Link>
                        
                        {/* User Info and Logout Section for Mobile */}
                        {isMobile && (
                            <div className="border-t border-gray-700 mt-auto pt-4 w-full space-y-4">
                               <div className="px-4 text-gray-400">
                                   Signed in as <span className="font-bold text-white">{user.username}</span>
                               </div>
                               <button onClick={() => { logout(); handleMenuClose(); }} className={buttonClass}>
                                   Logout
                               </button>
                            </div>
                        )}

                        {/* User Info and Logout for Desktop */}
                        {!isMobile && (
                            <>
                                <span className="text-gray-400">|</span>
                                <span className="font-semibold">{user.username}</span>
                                <button onClick={() => { logout(); handleMenuClose(); }} className={buttonClass}>
                                    Logout
                                </button>
                            </>
                        )}
                    </>
                ) : (
                    <>
                        <Link to="/login" className={linkClass} onClick={handleMenuClose}>Login</Link>
                        <Link to="/register" className={linkClass} onClick={handleMenuClose}>Register</Link>
                    </>
                )}
            </>
        );
    }

    return (
        <>
            {/* Main Navbar */}
            <nav className="bg-gray-800 text-white shadow-lg sticky top-0 z-20">
                <div className="container mx-auto px-4">
                    <div className="flex justify-between items-center py-4">
                        <Link to="/" className="text-xl font-bold hover:text-gray-300">
                          <div className='flex'>
                            <img
                                    src="data:image/png;base64,"
                                    alt="NeuroNote icon"
                                    className="h-8 w-8 mr-2"
                                />  NeuroNote
                          </div>
                        </Link>
                        <div className="hidden md:flex items-center space-x-4">
                            {renderNavLinks(false)}
                        </div>
                        <div className="md:hidden">
                            <button onClick={() => setIsMenuOpen(true)}>
                                <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16m-7 6h7" />
                                </svg>
                            </button>
                        </div>
                    </div>
                </div>
            </nav>

            {/* Mobile Menu Overlay */}
            <div
                className={`
                    fixed inset-0 z-30 transition-opacity duration-300
                    ${isMenuOpen ? ' bg-opacity-50' : 'bg-opacity-0 pointer-events-none'}
                `}
                onClick={handleMenuClose}
            >
                {/* Inner Menu that slides */}
                <div
                    className={`
                        fixed top-0 right-0 h-full w-4/5 max-w-sm bg-gray-800 shadow-xl
                        transition-transform duration-300 ease-in-out
                        ${isMenuOpen ? 'transform translate-x-0' : 'transform translate-x-full'}
                    `}
                    onClick={(e) => e.stopPropagation()} // Prevents menu from closing when clicking inside it
                >
                    <div className="flex flex-col h-full text-white p-4">
                        <div className="flex justify-between items-center mb-6">
                            <span className="text-xl font-bold">Menu</span>
                            <button onClick={handleMenuClose}>
                                <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
                                </svg>
                            </button>
                        </div>
                        <div className="flex flex-col space-y-2 flex-grow">
                           {renderNavLinks(true)}
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}